import React, { useState } from 'react';
import AdminRoutes from './AdminRoutes';
import ViewReservations from './ViewReservations';
import UserManagement from './UserManagement'; // Suponiendo que este componente exista o lo crearemos

function AdminDashboard() {
  const [section, setSection] = useState('routes');

  const renderSection = () => {
    switch (section) {
      case 'routes':
        return <AdminRoutes />;
      case 'reservations':
        return <ViewReservations />;
      case 'users':
        return <UserManagement />;
      default:
        return <AdminRoutes />;
    }
  };

  return (
    <div className="AdminDashboard">
      <header>
        <h1>Admin Panel</h1>
        <nav>
          <button onClick={() => setSection('routes')}>Manage Routes</button>
          <button onClick={() => setSection('reservations')}>View Reservations</button>
          <button onClick={() => setSection('users')}>Manage Users</button>
        </nav>
      </header>
      <main>
        {renderSection()}
      </main>
    </div>
  );
}

export default AdminDashboard;
